//feelings selection
import React from 'react';
//import './App.css';

function Feelings() {
  return (
    <div className="Feelings">
        <h2>
        How are you feeling today?
        </h2>
        <p>
        Please select the emotion that applied best to your whole day. 
        </p>
    </div>
  );
}

export default Feelings;
